import React from 'react';
import Filters from './Filters';
import CharacterList from './CharacterList';


const Home = props => {
    return (
        <React.Fragment>
            <Filters getQuery={this.getQuery}/>
            <CharacterList 
            data={this.state.data}
            query={this.state.query}/>
        </React.Fragment>
    );
};


export default Home;
